import * as api from '../api';

// Action Creators

export const signin = (formData, navigate) => async (dispatch) => {
    try {
        await api.signin(formData);
        navigate('/')
    } catch (error) {
        console.log(error.message);
    }
};

export const signup = (formData, navigate) => async (dispatch) => {
    try {
        await api.si
        navigate('/')
    } catch (error) {
        console.log(error.message);
    }
};
